import React from 'react';

import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <nav>
          <h2>Shop</h2>
          <ul>
            <li><a href="#">Home</a></li>
          </ul>
        </nav>
      </header>


    </div>
  );
}

export default App;
